import React from 'react';


const NavigationBar=({routeer,isSigned})=>{
  if(isSigned){
    return (<nav style={{display:'flex',justifyContent:'flex-end'}}>
      <p className='f3 link underline dim black pr3 pointer' onClick={()=>routeer('signin')} >Sign Out</p>
    </nav>);
  }else {
    return (
      <nav style={{display:'flex',justifyContent:'flex-end'}}>
        <p className='f3 link underline dim black pr3 pointer' onClick={()=>routeer('signin')} >Sign In</p>
        <p className='f3 link underline dim black pr3 pointer' onClick={()=>routeer('signup')} >Register</p>
      </nav>
    );
  }

}
export default NavigationBar;
